        }

        .nav .brand {
            display: flex;
            align-items: center;
            gap: 12px;
            font-weight: 700;
            color: var(--deep)
        }

        .brand .logo {
            width: 36px;
            height: 36px;
            border-radius: 6px;
            display: flex;
            align-items: center;
            justify-content: center;
            color: #fff;
            font-weight: 800
        }
        .nav .menu {
            display: flex;
            gap: 20px;
            align-items: center;
        }
        .nav .menu a {
            color: var(--deep);
            text-decoration: none;
            font-weight: 500;
        }
        .btn-login {
            background: var(--orange);
            color: #fff !important;
            padding: 10px 16px;
            border-radius: 22px;
            text-decoration: none;
            font-weight: 600;
        }

        /* HERO DASHBOARD */
        .hero {
            min-height: 300px;
            background-image: url('{{ asset('tailadmin/images/landingpages/gambarkota.png') }}');
            background-size: cover;
            background-position: center;
            position: relative;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .hero::before {
            content: "";
            position: absolute;
            inset: 0;
            background: rgba(0,0,0,0.35);
        }
        .hero-inner {
            position: relative;
            z-index: 2;
            text-align: center;
            color: #fff;
        }
        .hero-inner h1 {
            font-size: 48px;
            margin: 0;
        }
        .hero-inner p {
            font-size: 16px;
            opacity: .9;
        }

        /* FOOTER SAME */
        footer {
            background: #062b52;
            padding: 60px 20px;
            color: #fff;
            margin-top: 80px;
        }
        .footer-container {
            max-width: 1150px; margin: 0 auto;
            display: flex; flex-wrap: wrap;
            gap: 50px;
        }
        .footer-col { flex:1; min-width:260px; }
        .footer-logo {
            display:flex; align-items:center;
            gap:12px; font-size:18px; font-weight:700;
        }
        .footer-desc { margin-top:12px; font-size:14px; line-height:1.6; }
        .footer-col h3 { margin-bottom:16px; font-size:16px; font-weight:600; }
        .footer-links a {
            display:block; font-size:14px;
            margin-bottom:8px; color:#fff;
            text-decoration:none;
        }
        .footer-links a:hover { text-decoration:underline; }

        .footer-bottom {
            border-top:1px solid rgba(255,255,255,.25);
            margin-top:40px; padding-top:20px;
            display:flex; justify-content:space-between;
            font-size:13px; flex-wrap:wrap;
        }
        .footer-bottom a { color:#fff; text-decoration:none; }
        .footer-bottom a:hover { text-decoration:underline; }

        /* Map sizing + hover */
        #map {
            min-height: 640px;
        }
        #map svg {
            width: 100%;
            height: 100%;
        }
        #map svg path {
            transition: fill 150ms ease, transform 150ms ease;
            cursor: pointer;
        }
        #map svg path:hover {
            fill: #fb923c !important; /* orange-400 */
            transform: translateY(-1px);
        }

        .tooltip-custom {
            position: absolute;
            background: rgba(15, 23, 42, 0.92);
            color: #e2e8f0;
            padding: 12px 14px;
            border-radius: 14px;
            box-shadow: 0 10px 40px rgba(15, 23, 42, 0.25);
            pointer-events: none;
            font-size: 13px;
            line-height: 1.5;
            z-index: 50;
        }
    </style>
